import logo from "./logo.svg";
import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Navbar from "./Navbar";
import AuditorHome from "./pages/AuditorHome";
import Account from "./pages/Account";
import Tenant from "./pages/Tenant";
import Error from "./pages/Error";
import Institutions from "./pages/Institutions";
import Institution from "./pages/Institution";
import FbChecklist from "./pages/FbChecklist";
import AuthenticatedRoute from "./components/testJwt/AuthenticatedRoute";
import LoginComponent from "./components/testJwt/Login";
// import FbCategoryB from "./pages/fbChecklistPages/FbCategoryB";
// import FbCategoryC from "./pages/fbChecklistPages/FbCategoryC";
// import FbCategoryD from "./pages/fbChecklistPages/FbCategoryD";
// import FbCategoryE from "./pages/fbChecklistPages/FbCategoryE";
import { ContextProvider } from "./Context";
import TenantHome from "./pages/TenantHome";
import ManagerHome from "./pages/ManagerHome";
import Store from "./pages/Store";
import EditAccountInfo from "./pages/ChangeAccountInfo";

function App() {
  return (
    <Router>
      <ContextProvider>
        <Switch>
          <Route exact path="/" exact component={LoginComponent} />
          <AuthenticatedRoute exact path="/home/a" exact component={AuditorHome} />
          <AuthenticatedRoute exact path="/home/t" exact component={TenantHome} />
          <AuthenticatedRoute exact path="/home/m" exact component={ManagerHome} />
          <AuthenticatedRoute exact path="/account" exact component={Account} />
          <AuthenticatedRoute exact path="/edit_account" exact component={EditAccountInfo} />
          <AuthenticatedRoute exact path="/institutions" exact component={Institutions} />
          <AuthenticatedRoute exact path="/institution/:institutionid" exact component={Institution} />
          <AuthenticatedRoute exact path="/tenant/:tenantId" exact component={Tenant} />
          <AuthenticatedRoute exact path="/tenant/fbChecklist/:tenantId" exact component={FbChecklist} />
          <AuthenticatedRoute exact path="/store" exact component={Store} />
          <AuthenticatedRoute exact path="/error" exact component={Error} />
        </Switch>
      </ContextProvider>
    </Router>
  );
}

export default App;
